import React from 'react'
import styled from 'styled-components'

const Section = styled.section`
width: 80%;
// display: flex;
justify-content: center;
align-items: center;
position: relative;
`

const Quote = ({text}) => {
  return (
    <Section>Quote</Section>
  )
}

export default Quote
